import { Route, Switch, Redirect } from "react-router-dom";
import AllQuotes from "../pages/AllQuotes";

function App() {
  return (
    <div>
      <Route path="/quotes">
        <AllQuotes />
      </Route>
      <Route path="quotes/:quoteId"></Route>
      <Route path="/new-quote"></Route>
    </div>
  );
}

export default App;
